import React from 'react'
const PriceCard = ({ data }) => {
    return ( 
    <div className="w3-center w3-text-gray" style={{height:'150px',width: '50%', marginBottom: '1em'}}>
        <b>{data.heading}</b>
        <p  style={{
                    marginTop:0,
                }}>{data.text}</p>
        <button
                type="button"
                className="w3-button w3-round-xxlarge w3-text-white"
                style={{
                    width:'100%',
                    margin:0,
                    backgroundColor: data.color
                }}
              >
                <b>{data.price}</b>
              </button>
    </div> );
}

export default PriceCard;
